action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>To be in good health, a child must have 3 meals a day and a snack: breakfast, lunch, snack, and dinner. </p>\\n\\n<p>A good diet should be <strong>varied and balanced</strong>. To have a balanced diet, the meals of one day must include<strong> at least one kind of food from each group.</strong> In other words, over a period of one day, your meals should include growth, protection, and energy foods.</p>\\n\"},\"subContentId\":\"0f50f147-dd97-49a1-9b2c-a975079e7f0e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1408505497188375,\"y\":42.81805930526572,\"width\":20.53394087427941,\"height\":23.6182161545777,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAeYAAAEbCAYAAAAPnycIAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAE7mlUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSLvu78iIGlkPSJXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQiPz4gPHg6eG1wbWV0YSB4bWxuczp4PSJhZG9iZTpuczptZXRhLyIgeDp4bXB0az0iQWRvYmUgWE1QIENvcmUgOS4wLWMwMDEgNzkuYzAyMDRiMiwgMjAyMy8wMi8wOS0wNjoyNjoxNCAgICAgICAgIj4gPHJkZjpSREYgeG1sbnM6cmRmPSJodHRwOi8vd3d3LnczLm9yZy8xOTk5LzAyLzIyLXJkZi1zeW50YXgtbnMjIj4gPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9IiIgeG1sbnM6eG1wPSJodHRwOi8vbnMuYWRvYmUuY29tL3hhcC8xLjAvIiB4bWxuczpkYz0iaHR0cDovL3B1cmwub3JnL2RjL2VsZW1lbnRzLzEuMS8iIHhtbG5zOnBob3Rvc2hvcD0iaHR0cDovL25zLmFkb2JlLmNvbS9waG90b3Nob3AvMS4wLyIgeG1sbnM6eG1wTU09Imh0dHA6Ly9ucy5hZG9iZS5jb20veGFwLzEuMC9tbS8iIHhtbG5zOnN0RXZ0PSJodHRwOi8vbnMuYWRvYmUuY29tL3hhcC8xLjAvc1R5cGUvUmVzb3VyY2VFdmVudCMiIHhtcDpDcmVhdG9yVG9vbD0iQWRvYmUgUGhvdG9zaG9wIDI0LjMgKFdpbmRvd3MpIiB4bXA6Q3JlYXRlRGF0ZT0iMjAyMy0wOS0wM1QxODo1ODowOSswMzowMCIgeG f essential nutrients resulting in serious health problems, such as slow growth and development, little energy to play, study, and exercise. </p>\\n\"},\"subContentId\":\"c3c05e69-c794-4093-8870-f32a08233618\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.281701099437675,\"y\":31.55014896177474,\"width\":17.11937517897093,\"height\":68.44737209794968,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAVEAAAKqCAYAAACDy20FAAAACXBIWXMAABcRAAAXEQHKJvM/AAAgAElEQVR4nO3de4xc53nf8Xd2l1yK1xV1pyRyaUcSJUtLsqbrsKVL0i6SuEVKOkELJ0ohDhQHMFCUEgRFaIuAo7oJoKiCqPxRB1DUoYAobhC0opzGdgtYXNlyJFtstFxZIik54pKhqLu4vIq33Sme2XOWs7NzOZf3nPNevh9gseRyLzOzw988z3s7JQUope5ev2pAKbUmeJM/rw7ei8HgrdmIUmo8+NgLwZ/lYyPPvHRgnMcVPiBEPRQE5qYgMDc2BKdOY0qpYaXUc/KeUIWrCFFP3L1+1dYgMMPwzNtuCdRnXjqwy/ffBdxCiDoqqDYlOLcE700hFekTSqmdVKdwASHqmKDilODcZvg9I0zhBELUAUHVeZ9S6p42E0AmkwB9+JmXDuz0/fcIOxGiFrt7/SoJzB1Bu657YihvMqtffualAyO+/P7gBkLUQkHluSOoPl1zP1UpbEKIWubu9asqSqntDlSenewKwpSxUhiPELXE3etXydKkqoVjnklJW7+ZIIXpevgNme/u9aseV0rt8ShAVbCWdU8w7gsYi0rUYHevX7UmqD6LWBxvivGgImXCCUYiRA0VrPesOj72GRWtPYxFO2+gu9evkln3ZwnQaWFrz+MB4xCihrl7/SqpPh/3/XFoIRzaAIzSy6/DHEGAmr5ds0irhm6+uvTa0Y+G/X0IYBrGRA1BgMYi46MEKYxAiBogWMLk4u6jrMgE00ommmACxkQLdvf6VdsI0NgGGB+FKRgTLVCwDvT73j4A6cj46L7Xjn50wOY7AfvRzhckWK7zqme7kHSTS5Cspa1HkWjni+PTPvisDDIUgqJRiRYg2I30rHd3PDsyyTTm6p2D2ahEcxa08Sym12uHS3cGdiFE83cfbbx22zjtCUUhRHMUVKHbvbnD+aIaRSEI0Xzdx6EimaEaRSEI0ZxQheaCbbPIHSGan21UoZnjRQq5I0Tzw3/w7A0E22iB3BCiOQi2dzJel0L/3Ln1twi22HkPYStCNB/3+HAns3Tr4I3qX276YpSfsJUJJuSJEM3HVh/uZJbuvG2lumXwRrXurtui/BQeb+SGEM0YrXx6y5ddq5bfcG39+3xl/Vp17VVXdvueVP7IDSGavU2u38GsfWX9P5rxE37jVzZ0Gx9dQ0uPvBCi2dvo+h3MkgTotVfNXBm
